/**
 * 
 */
public void initialize(URL uri, ContentObserver obs, JTabbedPane parent, TransacOrigin trOrigin) 
{
	this.uri = uri;
	this.obs = obs;
	this.parent = parent;
	this.trOrigin = trOrigin;
	
	ivjBrowser1.gotoLocation(uri);
	ivjidTxt.setText(obs.getIdElem());
	try{ivjBrowser1.setDocumentBaseString(uri.toString());}
	catch(MalformedURLException e){}
	ivjurlTxt.setText(uri.toString());

	showSource();

	if (!obs.isWriter())
	{
		ivjsaveBtn.setEnabled(false);
		ivjJEditorPane1.setEditable(false);
	}
}
