/**
 * Show the source code of the current HTML document in the text view tab
 */
public void showSource() 
{
	try
	{
		java.io.BufferedReader reader = new java.io.BufferedReader(ivjBrowser1.getHTMLSource());
		if (reader == null)
			return;
		String source = new String();
		String line = reader.readLine();
		while(line != null)
		{
			source += line+"\n";
			line = reader.readLine();
		}
		ivjJEditorPane1.setText(source);
	}
	catch(java.io.IOException  e)
	{
		ivjJEditorPane1.setText(e.toString());
	}
}
